import React from 'react';
import { BrowserRouter as Router, Routes, Route, Navigate } from 'react-router-dom';
import { ThemeProvider, createTheme } from '@mui/material/styles';
import CssBaseline from '@mui/material/CssBaseline';
import { AuthProvider } from './contexts/AuthContext';
import Layout from './components/Layout';
import Login from './pages/Login';
import Register from './pages/Register';
import SimpleDashboard from './pages/SimpleDashboard';
import ProfileSetup from './pages/ProfileSetup';

const theme = createTheme({
  palette: {
    primary: {
      main: '#1976d2',
    },
    secondary: {
      main: '#dc004e',
    },
  },
});

function App() {
  return (
    <ThemeProvider theme={theme}>
      <CssBaseline />
      <AuthProvider>
        <Router>
          <Layout>
            <Routes>
              <Route path="/login" element={<Login />} />
              <Route path="/register" element={<Register />} />
              <Route path="/dashboard" element={<SimpleDashboard />} />
              <Route path="/profile-setup" element={<ProfileSetup />} />
              <Route path="/exercises" element={<div style={{padding: '20px'}}><h2>Exercise Library</h2><p>Coming Soon...</p></div>} />
              <Route path="/nutrition" element={<div style={{padding: '20px'}}><h2>Nutrition Tracker</h2><p>Coming Soon...</p></div>} />
              <Route path="/progress" element={<div style={{padding: '20px'}}><h2>Progress Tracker</h2><p>Coming Soon...</p></div>} />
              <Route path="/achievements" element={<div style={{padding: '20px'}}><h2>Achievements</h2><p>Coming Soon...</p></div>} />
              <Route path="/profile" element={<div>Profile Page (Coming Soon)</div>} />
              <Route path="/" element={<Navigate to="/login" replace />} />
            </Routes>
          </Layout>
        </Router>
      </AuthProvider>
    </ThemeProvider>
  );
}

export default App;
